  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat polygon coverages are being
  created for the Olympic Coast National Marine Sanctuary (OCNMS). ROV, towedcamera
  sled, bathymetry data, sedimentary samples, and sonar mapping have been integrated
  to describe the geological, biological,and oceanographic aspects of habitat. OCNMS
  has collected side scan sonar, multibeam bathymetry, bottom grab and videodata to
  produce polygon coverages describing the benthic habitat for survey HMPR-116-2005-01d.
  The habitat polygons haveattributes for megahabitat, bottom induration, mesohabitat,
  macrohabitat and biology (where direct observations are available),polygon area
  and perimeter.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
